import React from 'react';
import './App.css';

class App extends React.Component {

  state = { 
    title: "Jay Wen", 
    headerLinks: [ 
      {title: "Home", path: '/'} 
    ],  }

  render() {

    return (
      <div className="App">
        <h1>jay's portfolio</h1>
      </div>
    );
  }
}

export default App;
